import React, { useState, useEffect } from 'react';
import api from '../api';

const Individual = () => {
  const [individuals, setindividuals] = useState([
    
  ]);

  useEffect(() => {
    api.get('/individual')
      .then(response => setindividuals(response.data))
      .catch(error => console.error('Erro ao obter indivíduos:', error));
  }, []);

  return (
    <div>
      <h2>Individual</h2>
      <ul>
        {individuals.map(individual => (
          <li key={individual.id}>{individual.nome} - {individual.descricao}</li>
        ))}
      </ul>
    </div>
    
  );
};

export default Individual;
